The Football League Show 29.12.2013 

Duration: 1 hour 15 min

The congestion of the busy festive fixture list continues. In what could be a crucial promotion clash at Vicarage Road, Watford host QPR. Plus, there are highlights from Nottingham Forest's encounter with Leeds United. Manish Bhasin presents.
